import { store } from './App';

const Profile = () => {
  store.dispatch({ type: { loc: 'profile' } });

  const Content = ({ pagination, idx }) => (
    <>
      <table>
        <thead className="main-profile-content-thead" pagination id={idx}>
          <tr>
            <td className="main-profile-content-thead-name">
              {e} thead. 이름이 들어올 곳
            </td>
          </tr>
        </thead>
        <tbody className="main-profile-content-tbody" pagination id={idx}>
          <tr>
            <td className="main-profile-content-tbody-img">
              {e} tbody. 이미지가 들어올 곳
            </td>
          </tr>
        </tbody>
        <tfoot className="main-profile-content-tfoot" pagination id={idx}>
          <tr>
            <td className="main-profile-content-tfoot-start">가입일</td>
          </tr>
          <tr>
            <td className="main-profile-content-tfoot-end">탈퇴일</td>
          </tr>
        </tfoot>
      </table>
    </>
  );

  console.log(Content);

  return (
    <div className="main-profile-wrapper">
      <div className="main-profile-content">{Content}</div>
    </div>
  );
};

export default Profile;
